import React from 'react';
import ContactCard from './ContactCard';


function ContactList(props){
    const Contacts = props.ContactDetails;
    // console.log(Contacts);
    return (
        <div>
            <h3>Contact List</h3>
            <ContactCard Contacts = {Contacts}/>
        </div>
    )
}
export default ContactList;
